class ButtonControl {
    mainControl;
    map;
    container;
    buttons = {};
    savePointUrl;
    constructor(mainControl) {
        this.mainControl = mainControl;
    }
    onAdd(map) {
        this.map = map;
        this.map.on('click', (event) => this.deselectDirectories());
        //this.container = DOM.create('div', 'maplibregl-ctrl maplibregl-ctrl-group');
        this.container = document.createElement('div');
        this.container.className = 'maplibregl-ctrl';
        this.checkAddButtons();
        this.setupButtons();
        return this.container;
    }
    onRemove(map) {
        this.container.parentNode.removeChild(this.container);
        this.map = undefined;
    }
    checkAddGeoJsonLayer() {
        const geoJsonData = this.mainControl.query.get('geo'), type = this.mainControl.query.get('type') ?? DEFAULT_GEOJSON_TYPE;
        if (geoJsonData === null) {
            return;
        }
        this.addLayerHelper('geoJsonData', type, geoJsonData);
    }
    checkAddButtons() {
        const buttons = this.mainControl.getButtonsQuery();
        if (buttons === null) {
            return;
        }
        ajaxGet(buttons, (data) => {
            this.savePointUrl = data.savePointUrl;
            this.map.on('style.load', (event) => {
                this.addLayerButtons(data.buttons);
            });
            this.map.on('load', (event) => {
                this.addLayerButtons(data.buttons);
                this.setupIcons();
                this.checkAddGeoJsonLayer();
            });
        });
    }
    setupButtons() {
        const destination = document.getElementsByClassName('maplibregl-ctrl-top-left')[0];
        destination.append(document.getElementById('buttonHolder'));
    }
    addLayerButtons(layers, root = null) {
        for (const layer of layers) {
            this.addLayerButton(layer, root);
        }
    }
    removeLayerButtons(layers) {
        for (const layer of layers) {
            if (layer.id in this.buttons) {
                this.removeLayerButton(this.buttons[layer.id]);
            }
        }
    }
    addLayerHelper(id, type, data) {
        this.addLayerButton({ "id": id, "type": type, "class": "layer", "source": { "type": "geojson", "data": data }, "active": true });
    }
    generatorMap = {
        directory: layer => new DirectoryButton(layer, this),
        rain: layer => new RainButton(layer, this),
        layer: layer => new LayerButton(layer, this),
        reset: layer => new ResetButton(layer, this),
        about: layer => new AboutButton(layer, this),
        layerIds: layer => new LayerIdsButton(layer, this),
        externalLink: layer => new ExternalLinkButton(layer, this),
        route: layer => new RouteButton(layer, this),
    };
    generateButton(layer) {
        if (layer.class === undefined) {
            layer.class = 'externalLink';
        }
        if (!(layer.class in this.generatorMap)) {
            console.error(`could not find class ${layer.class} in generator map`);
        }
        return this.generatorMap[layer.class](layer);
    }
    addLayerButton(layer, root = null) {
        if (document.getElementById(layer.id) != null) {
            return;
        }
        const button = this.generateButton(layer);
        (root != null ? root : document.getElementById('buttonHolder')).appendChild(button.nav);
        if (layer.active) {
            button.select();
        }
    }
    removeLayerButton(button) {
        button.deselect();
        const id = button.layer.id;
        if (this.map.getSource(id) != null) {
            this.map.removeSource(id);
        }
        button.buttonElement.remove();
    }
    removeLayerButtonById(id) {
        const button = this.buttons[id];
        if (button !== undefined) {
            this.removeLayerButton(button);
        }
    }
    removeLayerById(id) {
        const button = this.buttons[id];
        if (button !== undefined) {
            button.deselect();
        }
    }
    deselectAll() {
        Object.values(this.buttons)
            .filter(button => button.buttonElement.classList.contains('active'))
            .forEach(button => button.deselect());
    }
    deselectGroup(group) {
        if (group === undefined) {
            return;
        }
        Object.values(this.buttons)
            .filter(button => button.layer.group === group &&
            button.buttonElement.classList.contains('active'))
            .forEach(button => button.deselect());
    }
    deselectDirectories(depth = undefined) {
        Object.values(this.buttons)
            .filter(button => button instanceof DirectoryButton &&
            (depth === undefined || button.layer.depth === depth) &&
            !button.layer.active && //ignore the ones that started on
            button.buttonElement.classList.contains('active'))
            .forEach(button => button.deselect());
    }
    setupIcons() {
        this.map.loadImage('sprite/2197.png').then(response => this.map.addImage('upright', response.data));
        this.map.loadImage('sprite/2198.png').then(response => this.map.addImage('downright', response.data));
        this.map.loadImage('sprite/27a1.png').then(response => this.map.addImage('right', response.data));
    }
}

class SaveControl {
    buttonControl;
    map;
    dummyContainer;
    constructor(buttonControl) {
        this.buttonControl = buttonControl;
    }
    onAdd(map) {
        this.map = map;
        this.dummyContainer = document.createElement('div');
        this.addSavePointListener();
        return this.dummyContainer;
    }
    onRemove(map) {
        this.dummyContainer.parentNode.removeChild(this.dummyContainer);
        this.map = undefined;
    }
    addSavePointListener() {
        this.map.on('click', (event) => {
            if (event.originalEvent.ctrlKey || event.originalEvent.metaKey) {
                this.fireSavePoint(event);
            }
        });
    }
    fireSavePoint(event) {
        if (this.buttonControl.savePointUrl === undefined) {
            return;
        }
        let category = prompt('please enter a category', 'edited');
        if (category == null) {
            return;
        }
        let title = prompt('please enter a title', '');
        if (title == null) {
            return;
        }
        let query = new URLSearchParams();
        query.set('point', pointToString(event.lngLat, 4));
        query.set('category', category);
        query.set('title', title);
        let url = `${this.buttonControl.savePointUrl}?${query}`;
        ajaxGet(url, (data) => {
            alert(data?.msg ?? 'failure');
        });
    }
}

